import classes from "./VehicleVariableList";
const VehicleVariableList = (props) => {
  return (
    <div className="container">
      <div className="row">
        {props.items.map((variableItem) => {
          return (
            <div className="col-md-4">
              <div className="card">
                <div className="card-header">{variableItem.Name}</div>
              </div>
            </div>
          );
        })}
      </div>
    </div>
  );
};
export default VehicleVariableList;
